import wiki from 'wikijs';

export async function getMajorArcana() {
    const page = await wiki().page('Major_Arcana');
    const tables = await page.tables();
    // const majorArcana = tables;
    console.log(tables);
    // console.log(majorArcana);
    return tables
}
